import axios from 'axios';
import React, { useEffect, useState} from 'react';

import PropTypes from 'prop-types';
var port = 1;

function Date({date, max, min, average}){
    return (
        <div class="temperature__data">
            <h3 class="temperature_date">{date}</h3>
            <h5 class="temperature_max">{max}</h5>
            <h5 class="temperature_min">{min}</h5>
            <h5 class="temperature_average">{average}</h5>
        </div>
    );
}
Date.propTypes ={
    date:PropTypes.string.isRequired,
    max:PropTypes.number.isRequired,
    min:PropTypes.number.isRequired,
    average:PropTypes.number.isRequired,
};

class Test extends React.Component{
    state ={
        isLoading: true,
        dates:[],
    };

    getDates = () => {
        const{
            data:{
                data: {dates},
            },
        } = axios.get("http://220.149.31.104:9090/api/formerData/temperature/list"+"/"+":port");
        console.log(dates);
        this.setState({dates, isLoading:false});
    };

    componentDidMount(){
        //여기서 영화 데이터 로딩!
        // setTimeout(() => {
        //     this.setState({isLoading:false});
        // },6000);
        this.getDates();
    }

    render(){
        const {isLoading, dates} = this.state;
        return (
            <section class="container">
                {isLoading?(
                    <div class="loader">
                        <span class="loader__text">Loading...</span>
                    </div>
                    ):(
                        <div class="dates">
                            {dates.map((date)=>(
                                <Date
                                    key={date.date}
                                    date={date.date}
                                    max={date.max}
                                    min={date.min}
                                    average={date.average}
                                />
                            ))}
                        </div>
                )}
            </section>

        );
    }
}

export default Test;
